import React from 'react'
import { Nav } from 'react-bootstrap'

function Navbar() {
    return (
        <React.Fragment>
            <Nav className="justify-content-center" activeKey="/">
                <Nav.Item href="/"></Nav.Item>
            </Nav>

        </React.Fragment>
    )
}

export default Navbar
